import React, { Component } from 'react';
import './component/css/App.css';
class App extends Component {
  render() {
    return (

      <div className="App">
        <header>


  <div className="appheader" id="myheader">

  <div className="inner_header">

    <div className="logo_container">
    <a href="index.html"><img class="logo" src={require("./component/img/Logo.png")}/></a>
  </div>
  <ul className="navigation">
    <a href="index.html"><li>Gigs</li></a>
    <a href="Page1.html"><li> Photos</li></a>
    <a href="Page3.html"><li>Registration</li></a>
    <a><li><input type="text" placeholder="Search..."/></li></a>
  </ul>

</div>
</div>

      </header>

        <p className="App-intro">
          To get started, edit <code>src/App.js</code> and save to reload.
        </p>
      </div>
    );
  }
}
export default App;
